export default function AlbumItem({ image, name, id }) {
  return (
    <div className="min-w-[180px] p-2 px-3 rounded cursor-pointer hover:bg-[#81B29A]">
      <img className="rounded-2xl" src={image} />
      <p className="font-bold mt-2 mb-1">{name}</p>
    </div>
  );
}
